import React, {Component} from 'react';
import './App.css';
import Header from './components/Header';
import Nav from './components/Nav';
import Article from './components/Article';

class App extends Component {
  constructor(props){
    super(props);
    this.state = [
      header =  {title:'react-app', body:'react practicing and discovering'},

    ]
  }
  render(){
    return (
      <div className="App">
        <Header title={this.state.header.title} body={this.state.header.body}></Header>
        <Nav></Nav>
        <Article title="artcle title" body="article body are landing here"></Article>
      </div>
    );
  }
}

export default App;
